CREATE VIEW [dbo].[contracts_by_id]
AS
SELECT dbo.contract_headers.ContractID, dbo.contract_lines.LineID, dbo.contract_headers.SupplierID, dbo.contract_headers.ContractDate, dbo.contract_headers.ExpirationDate, dbo.contract_headers.TotalAmount, dbo.contract_headers.Currency, dbo.contract_headers.Status, 
             dbo.contract_lines.ItemID, dbo.contract_lines.Quantity, dbo.contract_lines.UnitPrice, dbo.contract_lines.TotalPrice, dbo.contract_lines.DeliveryDate, dbo.contract_lines.ItemDescription
FROM   dbo.contract_headers INNER JOIN
             dbo.contract_lines ON dbo.contract_headers.ContractID = dbo.contract_lines.ContractID
